import './App.css';
import React from 'react';
import { connect } from 'react-redux';
import Header from './Components/Header.js';
import NavigationBar from './Components/NavigationBar';
import Services from './Components/Services';
import GalleryCarousel from './Components/GalleryCarousel';
import HowToFindUs from './Components/HowToFindUs';
import NewsCarousel from './Components/NewsCarousel';
import StaffMainMenu from './Components/StaffMainMenu';
import { enableRipple } from '@syncfusion/ej2-base';
import { TimePickerComponent } from '@syncfusion/ej2-react-calendars';
// enable ripple effect
enableRipple(true);
class App extends React.PureComponent {
  render() {
    var time = new Date('8/3/2017 10:00 AM');
    var minTime = new Date('8/3/2017 7:00 AM');
    var maxTime = new Date('8/3/2017 4:00 PM');

    if (this.props.employeeToken === '') {
      return (
        <div className="App">
          <div width="100px">
            <TimePickerComponent
              style={{ width: '50' }}
              id="timepicker"
              value={time}
              minTime={minTime}
              maxTime={maxTime}
              step={60}
              format={'HH:mm'}
            />
          </div>

          <Header />
          <NavigationBar />
          <div className="main">
            <div className="main_window">
              <div className="carousels">
                <NewsCarousel />
                <GalleryCarousel />
              </div>
              <Services />
              <HowToFindUs />
            </div>
          </div>
        </div>
      );
    } else {
      return (
        <div className="App">
          <Header />
          <NavigationBar />
          <div className="main">
            <div className="main_window">
              <StaffMainMenu />
            </div>
          </div>
        </div>
      );
    }
  }
}

function mapStateToProps(state) {
  return {
    employeeToken: state.employeeToken,
    responseDataList: state.responseDataList,
    activeMenu: state.activeMenu,
    testImage: state.testImage,
  };
}

function mapDispatchToProps(dispatch) {
  return {};
}

export default connect(mapStateToProps, mapDispatchToProps)(App);
